import React from 'react';

export default function User({ firstname, lastname, age, email }) {
    return (
        <div>
            {
                age >= 30
                    ? <p>Age: {age}. Dear {firstname} {lastname} is old enough</p>
                    : <p>Age is below 30. {firstname} is {age} years old</p>
            }
            <p>Email:
                <a href={`mailto: ${email}`}>email</a>
            </p>
            <br />
        </div>
    );
}
